import './header.css';
import { Link } from "react-router-dom";


function Header() {
  return(
    <header>
      <Link className='logo' to="/">MovieGuide</Link>
      <Link className='favorites' to="/favorites">My Movies</Link>
    </header>
  );
}

export default Header;
